window.bookSummaryJSON = "The epic, multimillion-selling science-fiction series continues! The second Dune installment explores new developments on the planet Arrakis, with its intricate social order and strange, threatening environment. <p> <i>Dune Messiah</i> picks up the story of the man known as Muad'Dib, heir to a power unimaginable, bringing to fruition an ambition of unparalleled scale: the centuries-old scheme to create a superbeing who reigns not in the heavens but among men.</p> <p> But the question is: DO all paths of glory lead to the grave?</p>"; 
